import React from 'react';

import ThemeContext from '../../context/theme';
import { Section, Card } from '../Globals';

class FeaturedGames extends React.Component {
  static contextType = ThemeContext;

  render() {
    return (
      <Section>
        <Card>Banner</Card>
      </Section>
    );
  }
}

export default FeaturedGames;
